using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;namespace Foundation{    /// <summary>    /// An NSURLQueryItem object represents a single name/value pair for an item in the query portion of a URL. You use query items with the queryItems property of an NSURLComponents object.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/Foundation/Reference/NSURLQueryItem_Class/index.html#//apple_ref/occ/cl/NSURLQueryItem"/>    [iOSVersion(8)]    [Export("")]    public class NSURLQueryItem : NSObject//, AnyObject, CVarArgType, Equatable, Hashable, NSCoding, NSCopying, NSObjectProtocol, NSSecureCoding, Printable    {        public NSURLQueryItem() { }        /// <summary>        /// Initializes a newly allocated query item with the specified name and value.        /// </summary>        /// <param name="name">The name of the query item. For example, in the URL http://www.apple.com/search/?q=iPad, the name parameter is q.</param>        /// <param name="value">The value for the query item. For example, in the URL http://www.apple.com/search/?q=iPad, the value parameter is iPad.</param>        [iOSVersion(8)]        public NSURLQueryItem(string name, string value) { }                /// <summary>        /// The name of the query item. (read-only)        /// </summary>        [iOSVersion(8)]        [Export("name")]        public string Name { get; private set; }                /// <summary>        /// The value for the query item. (read-only)        /// </summary>        [iOSVersion(8)]        [Export("value")]        [Optional]        public string Value { get; private set; }    }}